import React, { useState, useEffect } from "react";
// import { useInView } from "react-intersection-observer";
// import styles from "./test1.module.css";

interface ProcessSVGProps extends React.SVGProps<SVGSVGElement> {}

const boybook = ({ ...props }: ProcessSVGProps) => {
    const [hoveredIndex, setHoveredIndex] = useState<number>(0);
    const [visibleGroups, setVisibleGroups] = useState<number>(0);

    // Uncomment if you want to use inView functionality
    // const { ref, inView } = useInView({
    //     triggerOnce: true, // load only once
    //     threshold: 0.3, // 30% visible
    // });

    useEffect(() => {
        const interval = setInterval(() => {
            setVisibleGroups((prev) => {
                if (prev >= 3) { // Stop after 3 groups
                    clearInterval(interval);
                    return prev;
                }
                return prev + 1;
            });
        }, 1000);

        return () => clearInterval(interval); // Clean up on unmount
    }, []);

    useEffect(() => {
        const interval = setInterval(() => {
            setHoveredIndex((prev) => {
                if (prev < 3) {
                    return prev + 1; // Increment until 3
                }
                clearInterval(interval); // Stop after reaching 3
                return prev; // Return the last index
            });
        }, 3000); // Cycle every 3 seconds

        return () => clearInterval(interval);
    }, []);

    return (
        <div className="relative z-50">      
                <svg width="160" height="205" viewBox="0 0 160 205" fill="none" xmlns="http://www.w3.org/2000/svg" >

<g id="Frames">
<rect width="160" height="205" rx="2.23607" fill="url(#pattern0_134_90)"/>
</g>
<defs>
<pattern id="pattern0_134_90" patternContentUnits="objectBoundingBox" width="1" height="1">
<use href="#image0_134_90" transform="matrix(0.00064375 0 0 0.000484146 -0.34375 -0.0268293)"/>
</pattern>
<image id="image0_134_90" data-name="3d-cartoon-business-character.png" width="2000" height="2000" preserveAspectRatio="none" href="data:image/png;base64,"/>
</defs>
</svg>


</div>
    )
}

export default boybook;
